<tr>
    <td class="text-center" style="{{show_border_top}}">{{item_cnt}}</td>
    <td class="text-center" style="{{show_border_top}}">{{district_text}}</td>
    <td style="{{show_border_top}}">{{department_name}}</td>
    <td style="vertical-align: top !important; {{show_border_top}}">{{service_name}}</td>
    <td class="text-center" style="{{show_border_top}}">{{timeline}}</td>
    <td class="text-center f-w-b f-s-16px cursor-pointer" style="{{show_border_top}}"
        onclick="Dashboard.listview.changeRouter({{module_type}},{{district}});">{{total_app}}</td>
    <!--<td class="text-center bg-light-green f-w-b f-s-16px">{{ot_draft_app}}</td>-->
    <td class="text-center bg-light-green f-w-b f-s-16px cursor-pointer" style="{{show_border_top}}"
